      <div className='CARD border shadow-sm rounded-2 p-2'>
        <div className="card-title">
          Payment Methods
        </div>
        <div className='card-text d-flex'>
          <div>Cash:{' '}</div><span>{' '}0{' '}</span><span>{' '}|{' '} </span><span>Card:{' '}</span><span>{' '}0{' '}</span><span>{' '}|{' '}</span><span>PhonePay:{' '}</span><span>{' '}0{' '}</span><span>{' '}|{' '}</span><span>Wire_Transfer:{' '}</span><span>{' '}0{' '}</span><span>RazorPay:{' '}</span><span>{' '}0{' '}</span>
        </div>
      </div>
    </div>
  )
}

export { Appointments_Dsr }
